import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppComponent } from './app.component';
import { AppRoutingModule } from './app-routing.module'; // Importation du module de routage
import { AccueilComponent } from './components/utlisateur/accueil/accueil.component';
import { AdminContenerComponent } from './components/admin/admin-contener/admin-contener.component';

// Déclaration du module principal de l'application
@NgModule({
  declarations: [
    AppComponent, // Déclare le composant principal

  ],
  imports: [
    BrowserModule, // Importation du module de base pour Angular
    AppRoutingModule // Importation du module de routage,
    AccueilComponent, // Déclare le composant Accueil
    AdminContenerComponent // Déclare le composant AdminContener
  ],
  providers: [],
  bootstrap: [AppComponent] // Le composant principal qui va être bootstrapé
})
export class AppModule { }
